import React from 'react'
import './App3.css'
import Sidebar from './Sidebar'
import Chat from './Chat'
import {selectUser} from './features/userSlice'
import store from './app/store'
function App3() {
    const user=useSelector(selectUser)

  return (
  
    <div className="app">
    
    {user ?(
      <>
      <Sidebar />
      <Chat />
      </>
    ):(
      <h2>You need to login</h2>
    )}
   
    </div>
    
   
  )
}

export default App3
